column8:
綿率を約65%加えた糸を使用する事により、従来の合繊手袋に比べ、吸湿性・吸汗性に優れた商品です。

2本糸編です。

コストを追求した手袋です。


●注意： ※手首の糸の色が多少異なる場合があります。品質は変わりませんのでご了承願います。

●材質： 綿65%、ポリエステルその他35%&nbsp;

●サイズ： フリー&nbsp;

●全長(cm)： 約23&nbsp;

●糸本数(本)： 2本編


※パッケージには入っておりません。簡単な梱包となります。ご理解下さい。

